MOVIE INFO:
Release Date: 28 June 2011(USA)
Director: Michael Bay
Cast: Shia LaBeouf, Rosie Huntington-Whiteley, Tyrese Gibson, Josh Duhamel
Genre: Action, Adventure, Sci-Fi
Language: English
Plot: Autobots Bummblebee, Rachet, Ironhide and Sideswipe led by Optimus Prime, are back in action taking on the evil Decepticons, who are eager to avenge their recent defeat. The Autobots and Decepticons become involved in a perilous space race between the U.S. and Russia, to reach a hidden Cybertronian spacecraft on the moon and learn its secrets, and once again Sam Witwicky has to come to the aid of his robot friends. New villain, Shockwave, who rules Cybertron, is on the scene while the Autobots and Decepticons continue to battle it out on Earth.
